angular.module('App',['ngRoute','angAccordion','ngCookies','RecursionHelper'],function($httpProvider){
	// Use x-www-form-urlencoded Content-Type
	  $httpProvider.defaults.headers.post['Content-Type'] = 'application/x-www-form-urlencoded;charset=utf-8';

	  /**
	   * The workhorse; converts an object to x-www-form-urlencoded serialization.
	   * @param {Object} obj
	   * @return {String}
	   */ 
	  var param = function(obj) {
	    var query = '', name, value, fullSubName, subName, subValue, innerObj, i;

	    for(name in obj) {
	      value = obj[name];

	      if(value instanceof Array) {
	        for(i=0; i<value.length; ++i) {
	          subValue = value[i];
	          fullSubName = name + '[' + i + ']';
	          innerObj = {};
	          innerObj[fullSubName] = subValue;
	          query += param(innerObj) + '&';
	        }
	      }
	      else if(value instanceof Object) {
	        for(subName in value) {
	          subValue = value[subName];
	          fullSubName = name + '[' + subName + ']';
	          innerObj = {};
	          innerObj[fullSubName] = subValue;
	          query += param(innerObj) + '&';
	        }
	      }
	      else if(value !== undefined && value !== null)
	        query += encodeURIComponent(name) + '=' + encodeURIComponent(value) + '&';
	    }

	    return query.length ? query.substr(0, query.length - 1) : query;
	  };

	  // Override $http service's default transformRequest
	  $httpProvider.defaults.transformRequest = [function(data) {
	    return angular.isObject(data) && String(data) !== '[object File]' ? param(data) : data;
	  }];
})
.config(function($routeProvider) {
	
    $routeProvider
    .when("/", {
        templateUrl : "ForumClient/views/forums.html",
        activelink: 'forums'
    })
    .when("/users", {
        templateUrl : "ForumClient/views/users.html",
        activelink: 'users'
    })
    .when("/new-forum", {
        templateUrl : "ForumClient/views/new-forum.html",
        activelink: 'new-forum'
    })
    .when("/new-theme", {
        templateUrl : "ForumClient/views/new-theme.html",
        activelink: 'new-theme'
    })
    .when("/themes", {
        templateUrl : "ForumClient/views/themes.html",
        activelink: 'themes'
    }).otherwise({ redirectTo: '/' });
    
    
  
})
.controller('AppCtrl',['$cookies',function($cookies){

}])
.directive("tree", function(RecursionHelper) {
    return {
        restrict: "E",
        scope: {family: '='},
        template: 
        '<div class="row">'+
            '<div class="col-sm-2 text-center">' +
            '<img src="data:image/jpeg;base64," class="img-circle" height="65" width="65" alt="Avatar">' +
            '</div>' + 
            '<div class="col-xs-10">' +
              '<h4>{{family.Author}} <small>{{family.DateOfCreation}}</small></h4>' +
                 '<p>{{family.Content}}</p>' +
                 '<div class="votes" ng-if=loged>' +
               	 '<button type="button" class="btn btn-default btn-sm" ng-click="likeComment(family.Forum,family.CommentId)">' +
                 '<span class="glyphicon glyphicon-thumbs-up"></span> {{family.PositiveVotes}}' +
                 '</button>' +
                 '<button type="button" class="btn btn-default btn-sm" ng-click="disLikeComment(family.Forum,family.CommentId)">' +
                 '<span class="glyphicon glyphicon-thumbs-down"></span> {{family.NegativeVotes}}' +
                 '</button>' +
                 '<button ng-if=canDelete type="button" class="btn btn-danger btn-sm" style="margin-left : 8px;" ng-click="deleteComment(family.CommentId,family.Forum)">' +
                 'Delete comment' +
                 '</button>' +
                 '</div>' +
                 '<div ng-if=loged>' +
	                 '<i class="reply"  ng-click="reply(family.CommentId, family.Forum, family.Theme)">Reply</i>' +
	                 '<div class="form-group">' +
	                 '<textarea class="form-control" rows="2" id="{{family.CommentId}}" ng-model="content"></textarea>' +
	                 '</div>' +
                 '</div>' +
                 
                    '<br>' +
                    '<div  id="{{family.CommentId}}">' +
                         '<div ng-repeat="child in family.Contain" style="width: 1000px;">' +
                        '<tree family="child" ></tree>' +
                        '</div>' +
                    '</div>' +
              '</div>',
        controller : function ($scope,$http,$cookies,$rootScope) {
        	
        	$scope.loged = $rootScope.isLoged;
        	$scope.canDelete = false;
        	
        	var themeAuthor = $scope.family.ThemeAuthor;
        	
        	if($cookies.get('username') == $cookies.get('currentModerator') || $cookies.get('username') == themeAuthor || $cookies.get('role') == 'admin')
        		$scope.canDelete = true;
        	
        	
        	
        	$scope.deleteComment = function(id, forum){
        		$http.post('/Forum/DeleteCommentServlet', {id : id}).then(function (success) {
        			
        			var config = {
        					params : {
        						forum : forum
        					}
        			}
        			$http.get('/Forum/GetCommentsForForumServlet', config)
        			.then(function (success)  {
        			    $scope.$emit('comment-updated', success.data);
    				});
        		});
        	}
        	
        	
        	
        	
        	$scope.reply = function (id, forum, theme) {
        		
        		var content = $('#'+ id +'').val();
        		
        		if(content != ""){
        		$http.post('/Forum/AddNewCommentServlet', { parentId : id, theme : theme, forum : forum, author : $cookies.get('username'), content : content})
        		.then(function (success) {
        			if(success.data == 'Success'){
        				var config = {
            					params : {
            						forum : forum
            					}
            			}
        				$http.get('/Forum/GetCommentsForForumServlet', config)
            			.then(function (success)  {
            			    $scope.$emit('comment-updated', success.data);
        				},
        			    function (error) {
        					
        				});
        				
        			}
        				
        		}, function () {
        			
        		});
        		
        	    }
        	}
    		
    		$scope.likeComment = function (forum,commentId){
    			
    			$http.post('/Forum/AddCommentLikeServlet',{userName : $cookies.get('username'), forum : forum, commentId : commentId})
    			.then(function (success) {
    				$scope.$emit('comment-updated', success.data);
    			}, function () {
    				
    			});
    		}
    		
            $scope.disLikeComment = function (forum,commentId){
    			
    			$http.post('/Forum/AddCommentDisLikeServlet',{userName : $cookies.get('username'), forum : forum, commentId : commentId})
    			.then(function (success) {
    				$scope.$emit('comment-updated', success.data);
    			}, function () {
    				
    			});
    		}
        		
        },
        compile: function(element) {
            return RecursionHelper.compile(element, function(scope, iElement, iAttrs, controller, transcludeFn){
               
           
            	
            	
            });
        }
    };
  })
.run(function ($rootScope,$cookies,$location){
	
	var cookieData = $cookies.get('role');

	if(cookieData == 'admin')
		$rootScope.isAdmin = 'true';
	if(cookieData == 'moderator')
		$rootScope.isModerator = 'true';
	if(cookieData == 'user')
		$rootScope.isUser = 'true';
	
	 $rootScope.$on("$locationChangeStart", function(event, next, current) { 
	     //   if($cookies.get('role') == null)
	      //  	$location.path( "/" );
		 	if(next == "http://localhost:8080/Forum/#/themes")
	        	$location.path( "/themes" );
	        if(next == "http://localhost:8080/Forum/#/users" && $cookies.get('role') != 'admin')
	        	$location.path( "/" );
	        if(next == "http://localhost:8080/Forum/#/new-forum" && $cookies.get('role') != 'admin' && next == "http://localhost:8080/Forum/#/new-forum" && $cookies.get('role') != 'moderator')
	        	$location.path( "/" );
	        	
	        	
	    });

});